const HeaderHome = () => {

  //COMPONENTE HEADER DEL HOMEPAGE
  return (
 
      <div className="">
{/*        <img src={require('../../../img/eicblanco.png').default} />
       <img src={require('../../../img/ucn400x112.png').default} /> */}

       <Stack direction="row" spacing={2}>
        <Avatar alt="Remy Sharp" src="../../../img/eicblanco.png" />
        <Avatar alt="Travis Howard" src="../../../img/ucn400x112.png" />
        <Avatar alt="Cindy Baker" src="../../../img/ucn400x112.png" />
        </Stack>

      </div>
  )
}

export default HeaderHome
